import React from 'react'
import './LangCards.css'
import {Link} from "react-router-dom";

export default function LangCards(props) {
  return (
    <>
        <div class="card" >
        <Link></Link>
        <div><img src={props.source} class="card-img-top" alt="..."/></div>
          <div class="card-body">
            <h5 class="card-text">{props.value}</h5>
          </div>
        </div>
    </>
  )
}
